import React, { useState } from "react";
import axios from "axios";
import Albums from "../components/Albums";
// import Pagination from "../components/Pagination copy";
import PaginationComponent from "../components/Pagination copy";

class Homecopy extends React.Component {
  state = {
    albums: [],
  };

  getAlbums = async () => {
    // const albums = await axios.get('https://jsonplaceholder.typicode.com/albums');
    const { data } = await axios.get(
      "https://jsonplaceholder.typicode.com/albums"
    );

    this.setState({ albums: data });
  };

  componentDidMount() {
    this.getAlbums();
  }
  render() {
    const { albums } = this.state;
    return (
      <div>
        {albums.map((album) => (
          <Albums
            key={album.id}
            title={album.title}
            id={album.id}
            img={
              "https://images.saymedia-content.com/.image/t_share/MTc0NDkxNzgyMzYzNDg5NjQw/vinyl-to-paper-how-to-write-an-album-review.jpg"
            }
          />
          ))}
          <PaginationComponent />
      </div>
    );
  }
}
